import Mainpart from './components/Main-Part/Mainpart'

const App = () => {
  return (
    <div>
      <Navbar/>

      {/* <Mainpart/> */}
      <Mainpart/>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
  )
}

export default App
